import React, { useState, useEffect } from "react";
import "./Dashboard.css";

// Utility function moved outside the component
const countryList = [
  { name: "India", code: "IN" },
  { name: "United States", code: "US" },
  { name: "United Kingdom", code: "GB" },
  { name: "Australia", code: "AU" },
  { name: "Germany", code: "DE" },
  { name: "Canada", code: "CA" },
  { name: "France", code: "FR" },
  { name: "Japan", code: "JP" },
  { name: "China", code: "CN" },
  { name: "Russia", code: "RU" }
];

const getCountryCode = (countryName) => {
  const match = countryList.find((c) => c.name === countryName);
  return match ? match.code.toLowerCase() : "";
};

const Dashboard = () => {
  const [countries, setCountries] = useState([]);
  const [selectedCountry, setSelectedCountry] = useState("");
  const [activePanel, setActivePanel] = useState("Live News Feed");
  const [news, setNews] = useState([]);

  const API_KEY = "pub_788677aa36735d8282ee66b9146090ddf3d0f";

  // Fetch country list
  useEffect(() => {
    fetch("https://restcountries.com/v3.1/all")
      .then((response) => response.json())
      .then((data) => {
        const countryNames = data.map((country) => country.name.common).sort();
        setCountries(countryNames);
      })
      .catch((error) => console.error("Error fetching countries:", error));
  }, []);

  // Fetch news for selected country
  useEffect(() => {
    if (selectedCountry && activePanel === "Live News Feed") {
      fetch(
        `https://newsdata.io/api/1/news?apikey=${API_KEY}&country=${getCountryCode(
          selectedCountry
        )}&language=en`
      )
        .then((res) => res.json())
        .then((data) => {
          setNews(data.results || []);
        })
        .catch((err) => console.error("Error fetching news:", err));
    }
  }, [selectedCountry, activePanel]);

  return (
    <div className="dashboard">
      <h1 className="title">Dashboard</h1>

      {/* Country Dropdown */}
      <div className="dropdown-container">
        <label>Select a Country:</label>
        <select
          className="dropdown"
          value={selectedCountry}
          onChange={(e) => setSelectedCountry(e.target.value)}
        >
          <option value="">-- Choose a Country --</option>
          {countryList.map((country, index) => (
            <option key={index} value={country.name}>
              {country.name}
            </option>
          ))}
        </select>
      </div>

      {/* Panel Buttons */}
      <div className="buttons">
        <button
          className={activePanel === "Live News Feed" ? "active" : ""}
          onClick={() => setActivePanel("Live News Feed")}
        >
          Live News Feed
        </button>
        <button
          className={activePanel === "AI-Analysis Summary" ? "active" : ""}
          onClick={() => setActivePanel("AI-Analysis Summary")}
        >
          AI-Analysis Summary
        </button>
        <button
          className={activePanel === "Recent Alerts Panel" ? "active" : ""}
          onClick={() => setActivePanel("Recent Alerts Panel")}
        >
          Recent Alerts Panel
        </button>
      </div>

      {/* Content Display */}
      <div className="panel-content">
        {activePanel === "Live News Feed" && (
          <div className="news-feed">
            {news.length > 0 ? (
              news.slice(0, 6).map((article, index) => (
                <div className="news-card" key={index}>
                  <h3>{article.title}</h3>
                  <p>{article.description?.slice(0, 120)}...</p>
                  <a href={article.link} target="_blank" rel="noopener noreferrer">
                    Read more →
                  </a>
                </div>
              ))
            ) : (
              <p>No news available. Try selecting a country.</p>
            )}
          </div>
        )}

        {activePanel === "AI-Analysis Summary" && (
          <div>
            <h2>🧠 AI Analysis</h2>
            <p>This section will contain summarized AI-based analysis.</p>
          </div>
        )}

        {activePanel === "Recent Alerts Panel" && (
          <div>
            <h2>🚨 Recent Alerts</h2>
            <p>This section will show real-time alerts for selected country.</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
